import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import { Navbar, Nav } from 'react-bootstrap';

impo;

class NavLink extends React.Component {
  render() {
    return (
      <Navbar.NavBar.Collapse id="responsive-navbar-nav">
        <Navbar.Nav className="AllLinks">
          <Navbar.Nav.Link>
            <Link
              className="navLiks"
              eventKey={ 2 }
              to="/search"
            >
              Search
            </Link>
          </Navbar.Nav.Link>
          <Navbar.Nav.Link className="navLiks" eventKey={ 2 } href="/favorites">
            Favorites
          </Navbar.Nav.Link>
          <Navbar.Nav.Link className="navLiks" eventKey={ 2 } href="/profile">
            Profile
          </Navbar.Nav.Link>
        </Navbar.Nav>
      </Navbar.NavBar.Collapse>

    );
  }
}
export default NavLink;
